import './App.css';

// 최신 자바스크립트는 클래스 안에 속하는 function은 function을 생략 원래 function render이나 생략
// 하나의 최상위 태그만 써야된다 !
class Subject extends Component {
  render(){
    return (
      <header>
          <h1>WEB</h1>
          world wird web;
      </header>
    );
  }
}

class App extends Component{
  render() {
  return (
    <div className="App">
      <Subject></Subject>
    </div>
    );
  }
}
export default App;
